  margin: 8px;
  border: 1px solid lightgrey;
  border-radius: 2px;
`;

const Title = styled.h3`
  padding: 8px;
`;
const TaskList = styled.div`
  padding: 8px;
`;

export default function Column({ column, tasks }) {
  console.log(tasks);
  return (
    <Container>
      <Title>{column.title}</Title>
      <TaskList>
        {/* {tasks.map(task => (
          <Task key={task.id} task={task} />
        ))} */}
      </TaskList>
    </Container>
  );
}
